export const fonts = {
  sans: 'Barlow, Arial',
  serif: '"Cormorant Unicase", "Palatino", "sans-serif"',
}

export const globalCSS = `
  @import url('https://fonts.googleapis.com/css?family=Cormorant+Unicase|Barlow');

  * {
    box-sizing: border-box;
  }

  body {
    background: pink;
    margin: 0;
  }
`
